import Navbar from './navbar';
import './quiz.css';
import { Link } from 'react-router-dom';
import QuizContent1 from './QuizContent/quizContent1';
import QuizContent2 from './QuizContent/quizContent2';
import QuizContent3 from './QuizContent/quizContent3';
import {BrowserRouter as Router, Route, Switch } from 'react-router-dom';

const Quiz = () => {
    return ( 
    <Router>    
    <div class = "Quiz">
    <div class ="content">
    <h1>Beanz Quiz</h1>
    </div>

    <div class = "quiz-content">

            <div class = "quiz">
            <Switch>
            <Route path = "/">
              <QuizContent1/>
            </Route>
            <Route exact path = "/quizContent2">
              <QuizContent2/>
            </Route>
            <Route exact path = "/quizContent3">
              <QuizContent3/>
            </Route>
          </Switch>

            </div>
        </div>
        </div>
    </Router>

     );
}

export default Quiz;
